jQuery(document).ready(function() {
    jQuery('.p-postal-code').on('change', function (e) {
        let pref = '',
            address = '',
            code = jQuery(this).val();

        Object.keys(postalcodeData).every(function (idx) {
            if (typeof postalcodeData[idx][code] !== 'undefined') {
                pref = idx;
                address = postalcodeData[idx][code];
                return false;
            }
            return true;
        });
        if (pref) {
            let prefSelected = jQuery('.p-region-id > option:contains("'+pref+'")').val();
            if (prefSelected) {
                jQuery('.p-region-id').val(prefSelected);
            }
        }
        if (address) {
            jQuery('.p-street-address').val(address);
        }
    });
});